import { MantineProvider, Box, Card, TextInput } from "@mantine/core";
import { useForm } from "@mantine/form";
import axios from "axios";
import useState from "react";
import IUsuario from "src/interfaces/usuario";

function Home() {
  const [usuario, setUsuario] = useState < IUsuario > "";

  const form =
    useForm <
    {
      username: String,
      password: String,
    } >
    {
      initialValues: {
        username: "",
        password: "",
      },
    };

  const Autenticar = () => {
    axios.post(`http://localhost:8080/usuario/cadastro` + usuario);
  };

  return (
    <MantineProvider>
      <Box>
        <Card shadow={"1rem"} withBorder padding={"1rem"}>
          <TextInput></TextInput>
        </Card>
      </Box>
    </MantineProvider>
  );
}

export default Home;
